import React from "react";
// react plugin for creating charts
import ChartistGraph from "react-chartist";
// @material-ui/core

import { makeStyles } from "@material-ui/core/styles";
import Icon from "@material-ui/core/Icon";
// @material-ui/icons
import Add from "@material-ui/icons/Add";
import Remove from "@material-ui/icons/Remove";
import Store from "@material-ui/icons/Store";
import Warning from "@material-ui/icons/Warning";
import DateRange from "@material-ui/icons/DateRange";
import LocalOffer from "@material-ui/icons/LocalOffer";
import Update from "@material-ui/icons/Update";
import ArrowUpward from "@material-ui/icons/ArrowUpward";
import AccessTime from "@material-ui/icons/AccessTime";
import Accessibility from "@material-ui/icons/Accessibility";
import BugReport from "@material-ui/icons/BugReport";
import Code from "@material-ui/icons/Code";
import Cloud from "@material-ui/icons/Cloud";
// core components
import GridItem from "components/Grid/GridItem.js";
import GridContainer from "components/Grid/GridContainer.js";
import Table from "components/Table/Table.js";
import Tasks from "components/Tasks/Tasks.js";
import CustomTabs from "components/CustomTabs/CustomTabs.js";
import Danger from "components/Typography/Danger.js";
import Card from "components/Card/Card.js";
import CardHeader from "components/Card/CardHeader.js";
import CardIcon from "components/Card/CardIcon.js";
import CardBody from "components/Card/CardBody.js";
import CardFooter from "components/Card/CardFooter.js";
import Button from "components/CustomButtons/Button.js";
import { bugs, website, server } from "variables/general.js";
import Quote from "components/Typography/Quote.js";
import Muted from "components/Typography/Muted.js";
import Primary from "components/Typography/Primary.js";
import Info from "components/Typography/Info.js";
import Success from "components/Typography/Success.js";
import SuccessTitle from "components/Typography/SuccessTitle.js";
import PrimaryTitle from "components/Typography/PrimaryTitle.js";
import InfoTitle from "components/Typography/InfoTitle.js";
import {
  dailySalesChart,
  emailsSubscriptionChart,
  completedTasksChart
} from "variables/charts.js";

import styles from "assets/jss/material-dashboard-react/views/dashboardStyle.js";
// view
import Home from "views/home/home.js";

const useStyles = makeStyles(styles);

export default function Dashboard() {
  const classes = useStyles();
  return (
    <div>
        <Table
            tableHeaderColor="info"
            tableHead={['Name ','email ','service','remuneration','remote','date','Industry','Qualification','Experience','Certificates','Systems','','']}
            tableData={[
                [<PrimaryTitle> text entry  </PrimaryTitle> , <PrimaryTitle>Text entry </PrimaryTitle>, <Primary> pouet </Primary>,<Button justIcon round color="info"><Add /></Button> ],

                [ <Info>Vasanthi Kasinathan </Info> , <Info> office@fundspartnership.com </Info>, <Info> Fund Controller </Info>,<Info> $9k per/mth </Info>, <Info> yes </Info>, <Info> n/a </Info>, <Info> oil and gas</Info>, <Info>    • Singapore Accountants Academy
                                                                                                                                                                                                                                      	ACCA (1997)
                                                                                                                                                                                                                                      	FCCA (2002)

                                                                                                                                                                                                                                          • Institute of Business Studies (1987)
                                                                                                                                                                                                                                      	LCCI Diploma in Cost Accounting

                                                                                                                                                                                                                                          • Methodist Girls Secondary School, Malaysia (1985)
                                                                                                                                                                                                                                      	GCE ‘O’ Levels </Info>, <Info>
                                                                                                                                                                                                                                        Pacific Star Financial Pte Ltd Oct 2010 - Present
                                                                                                                                                                                                                                        Fund Controller.
                                                                                                                                                                                                                                        Frasers Centrepoint Asset Management (Commercial) Ltd (REIT Manager) Apr 2005 – Mar 2010.
                                                                                                                                                                                                                                        International Mezzanine Fund Management Ltd (Fund Management)
                                                                                                                                                                                                                                        Finance Manager
                                                                                                                                                                                                                                        Period: 2004 – 2005 .
                                                                                                                                                                                                                                        Internet Security Systems Pte Ltd (Southeast Asia & India) (Internet Security Provider)
                                                                                                                                                                                                                                        Accountant cum HR & Admin Manager
                                                                                                                                                                                                                                        Period: 2000 – 2004
                                                                                                                                                                                                                                        Tang Cheng Lin & Co (Public Accountant)
                                                                                                                                                                                                                                        Payroll & Accounts Executive
                                                                                                                                                                                                                                        Period: 1998 - 1999

                                                                                                                                                                                                                                        BSN Commercial Bank, Melaka, Malaysia (Bank)
                                                                                                                                                                                                                                        Bank Officer
                                                                                                                                                                                                                                        Period: 1997 – 1998

                                                                                                                                                                                                                                        Matsushita Denshi (S) Pte Ltd (Semi-conductor)
                                                                                                                                                                                                                                        Accounts Assistant
                                                                                                                                                                                                                                        Period: 1995 - 1997

                                                                                                                                                                                                                                        Neptune Orient Lines Ltd (NOL) (Shipping)
                                                                                                                                                                                                                                        Assistant Executive
                                                                                                                                                                                                                                        Period: 1990 - 1995

                                                                                                                                                                                                                                        </Info>, <Info> </Info>, <Info> </Info>,<Button type="button" color="info" href= "Home">See more </Button> ,<Button justIcon round color="info"><Remove /></Button> ] ,
                [ <Info>Gloria Cheng Ge Fang </Info> , <Info> </Info>, <Info> </Info>,<Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>,<Button type="button" color="info">See more</Button>,<Button justIcon round color="info"><Remove /></Button> ] ,
                [ <Info>Vasanthi Kasinathan </Info> , <Info> </Info>, <Info> </Info>,<Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>,<Button type="button" color="info">See more</Button>,<Button justIcon round color="info"><Remove /></Button> ],
                [ <Info>Vasanthi Kasinathan </Info> , <Info> </Info>, <Info> </Info>,<Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>, <Info> </Info>,<Button type="button" color="info">See more</Button>,<Button justIcon round color="info"><Remove /></Button> ]
            ]}
        />
    </div>
  );
}
